      const self = this

      this.$anime({
        targets: '#orc path',
        strokeDashoffset: [self.$anime.setDashoffset, 0],
        easing: 'easeInOutSine',
        duration: 1000,
        delay(el, i) {
          return i * 25
        },
        direction: 'alternate',
        loop: true,
      })

      this.$anime({
        targets: '#orc #orc-element',
        translateY: 3,
        easing: 'easeInOutSine',
        duration: 1500,
        delay(el, i) {
